window.bookSummaryJSON = "<p>\"Run, Rabbit, Run.\"</p> <p>After weeks in the Esposito Hotel, I now know three things: 1. The Gentlemen are liars. 2. The Trilogy took my sister. 3. My father is insane.</p> <p>I've been reminded of who I am and who my enemies are. Nico lied to me, and Beck and Rush backed him up.</p> <p>I'm on my own again-the spare to the heir, with nothing to lose and no one I can trust. All I care about is finding Sophie, and getting the hell out of St. Adrian. I'm ready to run.</p> <p>But, with three brutal men willing to hunt me down, and the force of my father's whole army on my tail . . . wish me luck.</p> <p>The clock is ticking . . .</p> <p>Contains mature themes.</p>"; 
